import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function CvJson() {
    // State to store the CV data
    const [cvData, setCvData] = useState(null);
  
    // Effect to fetch the CV data when the component mounts
    useEffect(() => {
      // Fetch the JSON file
      fetch('./cv.json')
        .then(response => response.json())
        .then(data => {
          // Set the fetched data to the state
          setCvData(data);
        })
        .catch(error => {
          console.error('Error fetching CV data:', error);
        });
    }, []); // Empty dependency array ensures the effect runs only once when the component mounts

    return cvData;
}

function CV() {
    // Call the CvJson function to fetch the CV data
    const cvData = CvJson();

    return (
        <div>
            <header>
                <h1>Linus Aspelof</h1>
                <nav>
                    <ul>
                        <li><Link to="/">Om Mig</Link></li>
                        <li><Link to="/About">Om Mig</Link></li>
                        <li className="active"><Link to="/CV">Cv</Link></li>
                        <li><Link to="/Portfolio">Portfolio</Link></li>
                        <li><Link to="/Kontakt">Kontakt</Link></li>
                    </ul>
                </nav>
            </header>

            <main id="cv-container">
                {/* Render CV data if available */}
                {cvData && (
                    <div>
                        <h2>{cvData.title}</h2>
                        {/* Render CV sections */}
                        {cvData.sections.map(section => (
                            <div key={section.id}>
                                <h3>{section.title}</h3>
                                <ul>
                                    {/* Render items within each section */}
                                    {section.items.map(item => (
                                        <li key={item.id}>
                                            {item.title}: {item.value}
                                        </li>
                                    ))}
                                </ul>
                            </div>
                        ))}
                    </div>
                )}
            </main>

            <footer>
                <p>&copy; 2024 Linus Aspelöf. All rights reserved.</p>
                <script src="/JS/cv.js"></script>
            </footer>
        </div>
    );
}

export default CV;
